x = [-b ± sqrt(b² - 4ac)] / 2a 

For this equation, a = 19, b = -1482, and c = 28640.

Plugging these values into the quadratic formula gives:

x = { [1482 ± sqrt((-1482)² - 4*19*28640)] / (2 * 19) }
x = { [1482 ± sqrt((2200324 - 2175360)] / 38 }
x = { [1482 ± sqrt(24964)] / 38 } 

∴ x = { [1482 ± 158] / 38 } 
So, the roots are x = 1640/38 = 43.16, and x = 1324/38 = 34.84 (rounded to two decimal places).
